import React from "react";
import "./Style.css";
import constant from "./constants";

let colors = constant.colors;
const Number = props => (
  <button
    className="Number"
    style={
      ({ width: props.value === "0" ? "120px" : "60px" },
      { color: colors[props.index] })
    }
  >
    {props.index}
  </button>
);

export default Number;
